import React from 'react';
import logo from './logo.svg';
import ReactDOM from 'react-dom';
import login from './components/login.jsx'
import './App.css';

function App() {
  ReactDOM.render(<login />, document.getElementById('login'));
  return (
    <div className="App">
      <div id="login"></div>
    </div>
  );
}

export default App;
